import React from "react";
import creditPic from "./creditPic.png";
import "./style.css";

function CreditCard ({children}) {
    return (
        <div class="col s5 m6">
            <div class="row valign-wrapper">
                <div class="col 1">
                    <img class="responsive-img" src={creditPic} style={{height:40}}>Inbox</img>
                </div> 
                <div class="col s5">   
                    <span class="flow-text" style={{ color: "black" }}>INBOX</span>
                </div>
                <div>
                    <h1 style={{ color: "green" }}>{children}</h1>
                </div>
            </div>
        </div>
    );
}

export default CreditCard;
